import DateAndTime from './component/DateAndTime';



const map = netflix.map(names => names);


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(

  <>
      <h1>Hello world</h1>
    <DateAndTime  date = {date} time = {time} contentE/>
    <h2>Top Netflix shows</h2>
    <div>
    <Show className = "card" keys = {map[0].key} names={map[0].value}/>
    <Show keys = {map[1].key} names={map[1].value}/>
    <Show keys = {map[2].key} names={map[2].value}/>
    <Show keys = {map[3].key} names={map[3].value}/>
